import React from 'react'
import { staticData } from './ProjectData'
import ProjectContainer from '../Project/ProjectContainer'

const Project = () => {

    
  return (
   <>
   <Element className="projectcontainer" id="projects">
    <h1>Projects</h1>
    <p>Here some projects which i have done using Front end Tools</p>
    <div className="projectcontainer__projects">
      {
        staticData.map((project,index)=>{
         return(
          <>
          const[id,img,title]=project
          <ProjectContainer key={index} img={img} title={project.title} />
          
          </>
         )


        })
      }

    </div>




   </Element>
   
   
   </>
  )
}

export default Project
